import React from 'react';
import './App.css';
import Home from './components/home';
import { BrowserRouter as Router, Route } from "react-router-dom";
import Sidebar from './components/Sidebar';
import BarChart1Page from './components/barChart1/BarChart1Page';
import BarChart2Page from './components/barChart2/BarChart2Page';
import BarChart3Page from './components/barChart3/BarChart3Page';
import LineChart1Page from './components/lineChart1/LineChart1Page';
import LineChart2Page from './components/lineChart2/LineChart2Page';
import LineChart3Page from './components/lineChart3/LineChart3Page';

import Chart3Page from './components/Chart3Page';

function App() {
  return (
    <div style={{display:"flex", flexDirection:"row"}}>
      <Sidebar />
      <div style={{width:"30px"}}></div>
      <Router>
        <Route exact path="/"><Home/></Route>
        <Route exact path="/barChart1"><BarChart1Page/></Route>
        <Route exact path="/barChart2"><BarChart2Page/></Route>
        <Route exact path="/barChart3"><BarChart3Page/></Route>
        <Route exact path="/lineChart1"><LineChart1Page/></Route>
        <Route exact path="/lineChart2"><LineChart2Page/></Route>
        <Route exact path="/lineChart3"><LineChart3Page/></Route>
        <Route exact path="/chart3"><Chart3Page/></Route>
      </Router>

    </div>
  );
}

export default App;
